;------------------------------------------------------------------------------
; PROJECT: MANA 
; VERSION: 0.0.1
;    FILE: mana.asm
;  AUTHOR: CRAIG IANNELLO, PUGBUTT.COM
;
; DESCRIPTION: 
;   DRAWS A TILEMAP FROM SQUARESOFT'S SNES TITLE: "SEIKEN DENSETSU 3".
;   REQUIRES AN HD6309 CPU IN NATIVE MODE AND A V9958 VIDEO DISPLAY PROCESSOR.
;
;------------------------------------------------------------------------------
                            ; V9958 VDP ADDRESSES
VDAT        EQU     $F400   ; PORT 0: VRAM DATA (R/W)
VREG        EQU     $F401   ; PORT 1: (R) STATUS REG, (W) FCN REG / VRAM ADDR
VPAL        EQU     $F402   ; PORT 2: (W) PALETTE REGISTERS
VIND        EQU     $F403   ; PORT 3: (W) REGISTER-INDIRECT ADDRESSING

;------------------------------------------------------------------------------
            ORG     $4000   ; VARS

TILEBUF     RMB     1024    ; FOR RASTERIZING ONE ROW OF TILES

            ORG     $A000   ; CODE AND DATA
; -----------------------------------------------------------------------------
VDP_G4_SZ   EQU     14      ; INIT SEQ FOR VDP MODE GRAPHICS4 (256 X 212 X 16)
VDP_G4_SEQ  FCB     $06,$80,$40,$81,$0A,$88,$80,$89,$1F,$82,$00,$8E,$00,$40
; -----------------------------------------------------------------------------
; PROGRAM ENTRYPOINT
; -----------------------------------------------------------------------------
ENTRYPOINT  LDX  #VDP_G4_SEQ ; SET MODE GRAPHICS4
VDP_INIT    LDA  ,X+
            STA  VREG
            CMPX #(VDP_G4_SEQ+VDP_G4_SZ)
            BLO  VDP_INIT
            LDX  #PALETTE   ; SET 16-COLOR PALETTE
            LDA  #0
            STA  VREG
            LDA  #$90
            STA  VREG
            LDE  #0
SET_PAL     LDA  ,X+
            STA  VPAL
            LDA  ,X+
            STA  VPAL
            INCE
            CMPE #16
            BLO  SET_PAL
            LDU  #TILEMAP   ; POINTER TO TILEMAP (ARRAY OF TILE ADDRESSES)
            LDB  #0         ; TILE ROW COUNTER
MAP_ROWS    LDF  #0         ; TILE COLUMN COUNTER
            LDY  #TILEBUF   ; DEST BUFFER FOR RENDERED TILES
MAP_ROW     LDX  ,U++       ; GET NEXT TILE ADDRESS FROM TILEMAP
            LDE  #0         ; TILE PIXEL ROW COUNTER
TILE_DRAW   LDA  ,X+        ; RENDER AN 8-PIXEL ROW OF TILE
            STA  ,Y+
            LDA  ,X+
            STA  ,Y+
            LDA  ,X+
            STA  ,Y+
            LDA  ,X+
            STA  ,Y+
            LEAY 124,Y      ; STRIDE TO NEXT PIXEL ROW OF DEST BUFFER
            INCE
            CMPE #8         ; REPEAT FOR ALL 8 PIXEL ROWS
            BLO  TILE_DRAW
            LEAY -1020,Y    ; RESET DEST BUF ADRS TO NEXT TILE POS.
            INCF 
            CMPF #32
            BLO  MAP_ROW    ; LOOP TO RENDER ALL TILES OF THE MAP ROW
            LDX  #TILEBUF
VDP_COPY    LDA  ,X+        ; COPY RENDERED PIXELS TO VDP
            STA  VDAT
            CMPX #(TILEBUF+1024)
            BLO  VDP_COPY
            INCB            ; COUNT FINISHED ROWS
            CMPB #26
            BNE  MAP_ROWS   ; LOOP UNTIL ALL MAP ROWS ARE DRAWN.
            RTS             ; ALL DONE.
; -----------------------------------------------------------------------------
; PALETTE, TILE MAP, TILES, AND RELATED DEFS
; -----------------------------------------------------------------------------
TILEMAP_W   EQU 32          ; MAP WIDTH IN TILES
TILEMAP_H   EQU 26          ; MAP HEIGHT IN TILES
NUM_TILES   EQU 287         ; NUM TILES IN TILESET

PALETTE                     ; 16-COLOR PALETTE %.RRR.BBB %.....GGG
